        <div className="text-center p-3">
            <h2>Claire's Pooch Sitting</h2>
        </div>
        <div className="text-center">
            <img src={mumslogo} className="img-fluid mx-auto" alt="cartoon dogs on a leash"/>
        </div>
    </header>
    )
}
